import React from "react";
import Meena from "./img/meena.jpg";

const Profile = () => {
  return (
    <div className="grid grid-cols-1 md:grid-cols-4">
      <div className="bg-green-50 shadow m-3 rounded-xl h-screen p-2">
        <div className="p-4 ">
          <img
            className="w-48 h-48 align-middle  rounded-full border-solid border-4 mx-auto"
            src={Meena}
            alt=""
          />
        </div>
      </div>
      <div className=" shadow col-span-3 m-3 rounded-xl bg-gray-300 h-screen p-2">
        Info
      </div>
    </div>
  );
};

export default Profile;
